// src/api/savedNodesAPI.js
export const fetchSavedNodes = async (UUID) => {
  try {
    const response = await fetch('/api/saved', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ UUID })
    });

    if (!response.ok) {
      const errorData = await response.json();
      throw new Error(errorData.error || 'Failed to fetch saved nodes');
    }

    return await response.json();
  } catch (error) {
    throw error;
  }
};

export const saveNode = async (UUID, nodeId) => {
  try {
    const response = await fetch('/api/save', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ UUID, node_id: nodeId })
    });

    if (!response.ok) {
      const errorData = await response.json();
      throw new Error(errorData.error || 'Saving failed');
    }

    return response.json();
  } catch (error) {
    throw error;
  }
};
